import styled from 'styled-components';
export const Div0 = styled.div`
    width: 90%;
    height: 55%;
    margin-left: 0%;
    margin-top: 0%;
    padding-left:1%;
    border-radius: 5px;
    border: 2px solid #8E8E8E;
    float: left;
    display: flex;
    justify-content: center;
    align-items: center;
    box-shadow: 2px 2px 3px 1px #D0D0D0;

`
export const Div1 =styled.div`
    font-family: sans-serif;
    text-align: center;
`
